import './App.css';
import { useState  } from 'react';
import Table from './components/Table';
import Modal from './components/Modal'

function App() {
  const [modalOpen, setModalOpen] = useState(false);
  return (
    <div className="App">
      <Table />
      <button className='btn' onClick={ () => {
        setModalOpen(true);
      }}>Add</button>
      { modalOpen && <Modal close /> }
    </div>
  );
}

export default App;
